%[text] ## Construction of phasor Array
%[text] ## Intro
%[text] The phasorArray class is a usefull tool to manipulate 3D array representing Periodic matrix, storing complex phasor along the third dimension. Obligatory, third dimension must me an odd number. 
%[text] Let's use the class PhasorArray to attach usefull function to a 3D matrix representing a periodic matrix and its phasor.
%[text] Consider A a 3D array of size $2h+1$ , A(:,:,h+1) is the 0-phasor of A, $A(:,:,(h+1)-m)$ and $A(:,:,(h+1)+m)$ are the $-m$ and $m$ phaors of A. 
%[text] The class allow construction, manipulation, edition of phasor in a smooth manner, and redifine all the basic operation (addition, substraction, multiplication, left/right inversion, transposition, conj transpore, real, imag ....) to apply to the periodic matrix instead of the array operation. 
%[text] ### Construting a phasorArray
%[text] #### From fourier coefficient : Construct A a 3D table, from phasor -2 to 2, use PhasorArray to create the object.
A_0=eye(2);
A_1=[1 1i;-1i,2];
A_2=[2*1i, exp(1i*1.89)/4; 0.5, -1];

A_ar=cat(3,conj(A_2),conj(A_1),A_0,A_1,A_2);
A=PhasorArray(A_ar) %[output:45efdc51]
%[text] Alternatively, specify that A represent a real valued periodic matrix, ie negative phasor are the conjugate of positive phasor, and feed the function only with the Zero and Positive part, and speficify the argument 'isreal' to true
A_arpos=cat(3,A_0,A_1,A_2);
A=PhasorArray(A_arpos,'isreal',true) %[output:8c7bb3c0]
%[text] The last way to construct PhasorArray is to specifiy individual periodic coefficient.
%[text] For that you can avoid the hassle to construct a 3D matrix, and provide a vector in order to define a scalar periodic PhasorArray. Using this, individual coeef can have different number of phasor but can still concatenate
a_11=ScalarPhasorArray([1,1,2*1i],'isreal',true) %[output:67123175]
a_12=ScalarPhasorArray([0,1i,exp(1i*1.89)/4, 1/7, 1/8*1i ],'isreal',true) %[output:99d15a2f]
a_21=ScalarPhasorArray([0,-1i,0.5],'isreal',true) %[output:57816517]
a_22=ScalarPhasorArray([1,2,-1],'isreal',true) %[output:21a78946]

A=[a_11,a_12;a_21,a_22] %[output:7b5223bc]
%[text] #### From a time signal : use inverse FFT to deduce correct Fourier decomposition and build the phasorArray object
T=2 %[output:864f002b]
sig = @(t) sawtooth(t/T*2*pi,0.5) %[output:706e0637]
figure %[output:50594194]
plot(0:1e-3:4,sig(0:1e-3:4)) %[output:50594194]

%[text] choose an appropriate **power of 2**
dt = 1/2^4;
t=(0:dt:(1-dt))*T;

y = sig(t);
%[text] Use the time2phasor method with a signal sample from 0 to T-dt on 2^m points
Y=PhasorArray.time2Phasor(y,"timeDim",2) %[output:3289d7f2]
hold on  %[output:50594194]
plot(Y,T,0:1e-3:4,linetype='-.') %[output:50594194] %[output:94d7cde9]
sgtitle('y(t) vs Y->y') %[output:94d7cde9]

YY = PhasorArray.funcToPhasorArray(sig,T); %[output:46217dc3]
hold on  %[output:94d7cde9]
plot(YY,T) %[output:94d7cde9]
legend('y','y->Y->y','sig->Y->y') %[output:3e64cea9] %[output:94d7cde9]
%[text] ### Display phasorArray
%[text] Display the 3D table inside, ie the fourier coeeficients
%display the 3D array
A.value %[output:71287ebd]
%[text] Display a stem plot of fourier coefficients, either showing real part, imag part, both, or abs. Default is an explosed view, one subplot for each coeeficient of A(t)
%stem plot
figure %[output:840778b4]
clf %[output:840778b4]
stem(A,display="real",scale="linear") %[output:840778b4]
sgtitle('Stem of real part of Phasor of A') %[output:840778b4]

figure %[output:7554a36a]
clf %[output:7554a36a]
stem(A,display="imag",scale="linear") %[output:7554a36a]
sgtitle('Stem of imag part of Phasor of A') %[output:7554a36a]

figure %[output:5f598c14]
clf %[output:5f598c14]
stem(A,display="abs",scale="linear") %[output:5f598c14]
sgtitle('Stem of abs value of Phasor of A') %[output:5f598c14]
%[text] Plot a time domain realisation of A(t) on a given time vector, for a given period T
%temporal plot
figure %[output:6c7a8e20]
clf %[output:6c7a8e20]
tt=0:0.001:4;
T=2;
plot(A,T,tt,"title",'A(t)') %[output:6c7a8e20]
%[text] Alternatively to stem, plot the abs value of phasor in a 3D bar chart, beware, as the matrix is first vectorized one direction
figure %[output:66ef6434]
barsurf(A) %[output:66ef6434]
%[text] The explosed option of stem can be disabled, resulting in a superposition of the different harmonics
figure %[output:34e1948d]
stem(A,"explosed",0,"scale","linear") %[output:34e1948d]
%%
%[text] ### Perform derivation and phase shift
figure %[output:909bda86]
plot(d(A,2),2,0:0.001:4,"title","A(t)'") %derivative of A, for a period T=2 %[output:909bda86]

figure %[output:29c0fc66]
plot(dephase(A,pi/2),2,0:0.001:4,"title","A(t+T/4)") %dephasage de A de pi/2 rad %[output:29c0fc66]
%[text] ### Edit PhasorArray
%[text] You can modify value of PhasorArray by two means
%[text] Access 3D array using parenthesis to manipulate it as a 3D array in regular matlab way
A(1,1,3)=5 % access the third page of 3D array, since A is of size 5, %[output:9c0cebae]
% the 3rd page is the central page,
% so it is the 0 phasor,
%  since we specify (1,1,3) we edit the value of the first coeeficient of
%  A(t)

A(1,1,(A.h+1)+0) = 5 %A.h produces the number of phasor in A %[output:59aefb39]
% so (A.h+1)+k is the index of the k-th phasor page
%[text] Alternatively **use bracket with 2 indices** to access coefficient subphasor array, you can use bracket indexing to totaly replace phasor value of specified coefficients
A{1,1} %extract the phasor Array of (1,1) element of A(t) %[output:74f512ee]
figure %[output:9ce97113]
plot(A) %[output:9ce97113]


figure %[output:6ea593f9]
plot(A{1,1}) %[output:6ea593f9]

A{1,1}=9;
hold on %[output:6ea593f9]
plot(A{1,1}) %[output:6ea593f9]

A{1,1}=ScalarPhasorArray([5 1/2*1i],'isreal',true); %replace a_11 with 5-sin(wt)
hold on %[output:6ea593f9]
plot(A{1,1}) %[output:6ea593f9]
%[text] You can also **use bracket with 3 indices** to assign to specific phasor BUT <u>unlike parenthesis indexing</u> the third argument is a phasor indices 
%[text] - A{1,2,3} access the third phasor of $a\_{12}$ in the same way A(1,1,3+1+A.h) does
%[text] - A{1,1,-3} is a licit indexing
%[text] - if k is too big (k \> A.h) the output is zero
%[text] - It is possible tu assign value with k \> A.h \
A{1,1,1} %[output:5b13bad2]
A(1,1,1+1+A.h) %[output:48a22f7f]
A{1,1:2,7} %[output:9f6ab03f]
A{:,:,-4} %[output:81e97724]

%change value of phasor -3 of a_11 and a_12
A{1,1:2,-3}=[1/4*1i 1/3+1i/5]  %[output:64c5aff0]

A{1,2,12}=0.1 %[output:22bd2201]
A{1,2,-12}=0.1 %[output:5e4194f1]
%[text] To access full phasor of  order k, an alternative to A{:,:,k} is A.phas(k)
A.phas(-3) %[output:0fe4a18d]
%[text] finally use A{:} to extract a vector form of A
A{:} %[output:166dfccb]
figure %[output:2d0bb5b1]
plot(A{:}) %[output:2d0bb5b1]
