%[text] ### Basic manipulation
%[text] We want to manipulate the 3D array (Phasor Array) as is they are matrices. Hence we redefine the + \* .\* / ./ ' .' operateur to produce result on the periodic matrices. 
%[text] A+4 (addition with a scalar) adds 4 only to the 0 phasor, C=A\*B realise the product of the periodic matrices st $C(t)=A(t)B(t)$, the is element wise product too : C=A.\*B means $c\_{kl}(t) = a\_{kl}(t) b\_{kl}(t)$ and so on for matrix division and element wise division. 
%[text] PhasorArray class define the addition in the sens of Matrix : AA=A+4 adds 4 only to the 0 phasor of A 
AA=A+8*eye(2) %[output:24248c9e]
figure %[output:49edbcd0]
plot(A) %[output:49edbcd0]
hold on  %[output:49edbcd0]
plot(AA) %[output:49edbcd0]


B=1/AA;
figure %[output:92c1f4c7]
plot(B,title='B(t)') %[output:92c1f4c7]
hold on  %[output:92c1f4c7]
plot(B*AA,title='B(t)*AA(t)')  %[output:92c1f4c7]

C=rand_phasor(2,2,5,"output","PhasorArray","time_structure","real") %[output:12689556]
figure %[output:297ba85f]
plot(C,title='C(t)') %[output:297ba85f]
figure %[output:3625451a]
stem(C) %[output:3625451a]
figure %[output:076c879f]
plot(A*C,title='product A(t) \times C(t)') %[output:076c879f]


figure %[output:204d2da3]
clf %[output:204d2da3]
stem(A*C) %[output:204d2da3]
figure %[output:39b4d686]
clf %[output:39b4d686]
plot(A.') %transpose et complexe transpose fonctionnent %[output:39b4d686]
hold on %[output:39b4d686]
plot(A) %[output:39b4d686]

%[text] You can perform smoothly addition and substraction of phasor array containing a different number of phasor as long as the first two dimmension are compatible
D=rand_phasor(2,2,4) %[output:50bbf9f1]
E=A-D %[output:21868b8f]

F=kron(A,D) %[output:24b526cc]
%[text] Basic function such as sum, trace, diag etc are available
diag(A) %[output:0672b874]
figure %[output:2063f635]
plot(diag(A)) %[output:2063f635]

trace(A) %[output:86d0054f]
figure %[output:59048549]
plot(trace(A)) %[output:59048549]

%[text] N.B. notice that $trace(\\mathcal{T}\_m(A))=\\frac{trace(A(t)\_0)}{2m+1}$
%[text] 
%[text] Power are defined
figure %[output:469823b1]
plot(A) %[output:469823b1]
figure %[output:594ab9ca]
plot(A^3) %[output:594ab9ca]
figure %[output:4ab94d02]
plot(A.^5) %[output:4ab94d02]
