%[text] ## Simulation of system
%[text] Lets take a random periodic matrix with imposed eigen value on S-N
figure %[output:731fabaa]
S=mreal(rand_phasor(2,2,7,"hurwitzeig",[-1 -0.3],"time_structure","hurwitz",output="PhasorArray")) %[output:62ccb1da]

tmax=15;
T=1 %[output:1de76440]
x0=rand(2,1);
[y,t]=lsim(S,tmax,x0,T,"plot",true,"isRealValued",1);  %[output:9a96ad08] %[output:731fabaa]
%isRealValue ensure only real value are used, tune this argument to true if
%the periodic matrices are real valued
title('x(t)') %[output:731fabaa]

figure %[output:9e94db2a]
plot(S{:},T,0:0.01:tmax,title='S(t)') %[output:9e94db2a]

figure %[output:0df9ad33]
plot(S.HmqNEig([],T),'*') %[output:0df9ad33]
title('eig(S-N)') %[output:0df9ad33]

%[text] We now add an input to the simulation
B=PhasorArray.random(2,1,5,"time_structure","real")+3 %[output:0d77a392]
figure %[output:3d5d610e]
plot(B,T,0:0.01:tmax) %[output:3d5d610e]

figure %[output:859a5bdd]
[y,t]=lsim(S,tmax,x0,T,B,"plot",true,"isRealValued",1); %[output:42bbd36f] %[output:859a5bdd]
title('x(t)') %[output:859a5bdd]

