%[text] ## Harmonic Array
%[text] Construct the Toeplitz Block Form and BlockToeplitz form of order h using the BT and TB method
h=5 %[output:1028974c]

%TB and BT matrix
A.TB(h) %[output:3b4d26a6]
A.BT(h) %[output:67039fce]

%en version sparse
A.spBT(h) %[output:9a92c5f0] %[output:9fa183aa]
A.spTB(h) %[output:28d4f9af]

T=1 %period %[output:21949ff2]
nx=2 %number of state %[output:0ee8477d]
NTB(nx,h,T) %[output:717eb760]
NBT(nx,h,T) %[output:3c93183c]

spNBT(nx,h,T) %[output:09ccf2f0]
spNTB(nx,h,T) %[output:781b315a]
figure %[output:0a56ffea]
barsurf(A.TB(10),'EdgeColor','interp') %[output:0a56ffea]
view([0 90.00]) %[output:0a56ffea]

%[text] The 'N' function accept a phasorArray as first argument and deduce from the first dimension of the matrix the number of state
NTB(A,h,T) %[output:85ccaf8d]
%[text] to compute the square hankel form used in LMI use
%[text]  \[$\\mathcal{H}\_{m,m}(A^+)\\mathcal{J}\_{m,m},\\mathcal{J}\_{m,m}\\mathcal{H}\_{m,m}(A^-),\\mathcal{H}\_{m,m}(A^+),\\mathcal{H}\_{m,m}(A^-)\]=A.TBHankel(h);$
%[text] BT hankel is not yet implemented
[HpJ,JHm,Hp,Hm]=A.TBHankel(h);
% [HpJ,JHm,Hp,Hm]=A.BTHankel(h); 

%sparse versions
[HpJ,JHm,Hp,Hm]=A.spTBHankel(h);
%[text] compute eigenvalue of A and eigen value of A-N
A.HmqNEig(h,T) %[output:0bd6505d]
A.HmqEig(h) %[output:6b4f863b]

%[text] Output sincos form, imag real form etc in the form of 3D array
u=ScalarPhasorArray([1 1/2 -1/2/1i],"isreal",1) %[output:5456816e]
% u = 1 + cos - sin
figure %[output:37f6f36f]
plot(u,1,0:0.01:2,title='u') %[output:37f6f36f]

u.SinCosForm %[output:7b3e6799]
u.ImagRealForm %[output:705adec2]
