%[text] ## Symbolic and sdpvar
%[text] The toolbox allows for definition of symbolic and sdp variable in the form of PhasorArray to perform all the previous operations
hP=5 %[output:1fe755f9]

%liste de sdp var servant aux phaseur 
P2=(sdpvar(size(A,1),size(A,2),hP,'symmetric','complex')) %[output:182ae2b2]
%sdpvar phaseur 0 (réel)
P1=(ndsdpvar(size(A,1),size(A,2),1,'symmetric','real')) %[output:91637288]
%sdpvar phaseur array
P = PosPart2PhasorArray(P1,P2) %[output:243c1c8d]
PT=P.TB(h) %[output:7c4098e8]

%ou directement avec la methode statique de PhasorArray
P = PhasorArray.ndsdpvar(2,2,5,PhasorType='symmetric',real=true) %[output:7eb9cbfa]

P=sdpval(P) %[output:86f1f2c5]
% P = value(value(P))
%to extract the value in P after optim
%[text] see LMI example for more details
%[text] 
%[text] Also, symbolic phasorArray are available
S = PhasorArray.sym(2,2,5,'s') %[output:9791c858]
S.TB(3) %[output:5cead5ed]
S.TBHankel(3) %[output:4f4a8886]

R = PhasorArray.random(2,2,2) %[output:96decc3a]

SymPlusR=TB(S+R,3) %[output:32ace207]
vpa(SymPlusR,3) %[output:541e1f25]
SymTimesR=TB(S*R,3) %[output:84456cd5] %[output:0a000dfa] %[output:32e8cbee]
vpa(SymTimesR,3) %[output:32a9d9f3]
