%[text] ## Lyapunov and Sylvester eq
A=mreal(rand_phasor(4,4,7,"hurwitzeig",[-1 -0.7 -0.1 -0.3],"time_structure","hurwitz",output="PhasorArray")) %[output:9836e989]
Q=PhasorArray(eye(4));

hp=10;
T0=1;

%A^TP + PA +Q =0
P=PhasorArray(Sylv_harmonique(A',A,Q,2*hp,2*pi/T0));
figure %[output:2447fbe9]
clf %[output:2447fbe9]
plot(P) %[output:2447fbe9]
P2 = A.lyap(Q,"T",T0,"thresholdResidual",1e-8) %auto adapt h until accuracy is reached %[output:5f591e63] %[output:0881f4ed]
hold on %[output:2447fbe9]
plot(P2) %[output:2447fbe9]

figure %[output:223d8500]
clf %[output:223d8500]
plot(real(P.HmqEig(40)),'*') %[output:223d8500]

nx=size(A,1) %[output:55d48390]
nz=2 %[output:618def73]

C=PhasorArray(rand_phasor(nz,nx,4,"time_structure","real")) %[output:25035d3f]
